import { Component, Vue }               from 'vue-property-decorator';
import Swal, { SweetAlertType }         from 'sweetalert2';
import VueSimpleAlert                   from 'vue-simple-alert';

import { STEP1, STEP2, STEP3, STEP4 }   from './register-seller-steps';
import { InputForms, TypeHelp }         from '@/models/inputForms';

import RegisterSellerService            from '@/services/register.service';
import UserStorage                      from '@/services/UserStorage';
import productsService                  from '@/services/products.service';
import { listStatusSellerValid } from '@/environments/list_status_valid';
import getUtmCookie from "@/helpers/getUtmCookie";
import {ListCategories} from "@/models/category";

import { Device } from '@capacitor/device';

@Component({})
export class RegisterSeller extends Vue {

    public titlePage: string = 'Faça o cadastro do seu negócio. É grátis!';
    public stepDefaul: string = '';
    public paramParther: string = '';
    public originByWay: string = '';

    public step: string = '';
    public step1: InputForms[] = STEP1;
    public step2: InputForms[] = STEP2;
    public step3: InputForms[] = STEP3;
    public step4: InputForms[] = STEP4;
    public optIn: string = 'phone';
    public refresh: boolean = false;
    public businessName: string = '';
    public email: string = '';
    public phone: string = '';
    public verificationType: string = '';
    public nextDisabled: boolean = false;
    public prevDisabled: boolean = true;
    public hasCpf: boolean = false;
    public deviceId: string = '';
    public subCategories: ListCategories[] = [];
    public isRegister: boolean = false;

    public showOptIn: boolean = false;
    public showVerificationCode: boolean = false;
    public showMapAddress: boolean = false;
    public isUpdate: boolean = false;

    private registerService = new RegisterSellerService();
    private productsService = new productsService();

    public stepToNumber = {
      "one": 1,
      "two": 2,
      "three": 3,
      "four": 4,
      "five": 5,
    };

    constructor() {
        super();
    }

    created() {
        this.stepDefaul = this.$route.query.etapa as string;
        this.$route.query.parceiro
            ? this.paramParther = this.$route.query.parceiro as string
            : this.paramParther = '';

        this.getChoicesGender();
        this.getChoicesSellersize();
        this.getListCategories();
        this.getStepForms();
        this.getStepOneTerms();
    }

    mounted() {
        this.setDeviceId();
        this.originByWay = getUtmCookie();
        const data = localStorage.getItem('loggedUser');
        if (data) {
            const statusSellerAccount = JSON.parse(data);
            if (!listStatusSellerValid.includes(statusSellerAccount.account_status)) {
                this.$router.push(`quero-vender?etapa=${statusSellerAccount.account_status}`);
            } else {
                this.$router.push(`dashboard`);
            }
        }
        this.isRegister = true;
    }

    private getStepForms() {
        (this.stepDefaul)
            ? this.setStep(this.convertAccountStatusToSteps(this.stepDefaul))
            : (localStorage.getItem('stepform'))
                ? this.setStep(localStorage.getItem('stepform') as string)
                : this.setStep('one');
    }

    public getStepOneTerms() {
        const stepOneTerms = localStorage.getItem('stepOneTerms') ? localStorage.getItem('stepOneTerms') : '';
        if (stepOneTerms) {
            this.nextDisabled = JSON.parse(stepOneTerms).terms;
        }
    }

    public setNextDisabled(value: boolean) {
        this.nextDisabled = value;
    }

    private async getChoicesGender() {
        const response = await this.registerService.getChoicesGender();
        switch (response.status) {
            case 200:
            case 201:
            case 202:
                const data = await response.json();
                this.step4[1].options = [];
                data.map((seller: any[]) => {
                    if (this.step4[1].options) {
                        this.step4[1].options.push({ id: seller[0], label: `${seller[0]} - ${seller[1]}` });
                    }
                });
                break;
        }
    }

    private async getChoicesSellersize() {
        const response = await this.registerService.getChoicesSellersize();
        switch (response.status) {
            case 200:
            case 201:
            case 202:
                const data = await response.json();
                this.step3[2].options = [];
                data.map((seller: any[]) => {
                    if (this.step3[3].options) {
                        this.step3[3].options.push({ id: seller[0], label: `${seller[0]} - ${seller[1]}` });
                    }
                });
                break;
        }
    }

    private async getListCategories() {
        const response = await this.registerService.getListCategories();
        switch (response.status) {
            case 200:
            case 201:
            case 202:
                const data = await response.json();
                this.subCategories = data;
                this.step3[0].options = data.map(category => {
                    return {
                        id: category.name,
                        label: category.name,
                    }
                });
                break;
        }
    }

    private setStep(step: string) {
        this.step = step;
        this.storageStepCurrent();
        this.setStorageModelSteps();
        this.setStepTitle();
    }

    private setStorageModelSteps() {
        switch (this.step) {
            case 'one':
                this.setModelsArrayInput('stepOne', this.step1);
                break;
                case 'two':
                this.setModelsArrayInput('stepTwo', this.step2);
                break;
            case 'three':
                this.setModelsArrayInput('stepThree', this.step3);
                break;
            case 'four':
                this.setModelsArrayInput('stepFour', this.step4);
                break;
        }
    }

    public prevStep() {
        switch (this.step) {
            case 'two':
                this.setStep('one');
                break;
            case 'three':
                this.setStep('two');
                break;
            case 'four':
                this.setStep('three');
                break;
            case 'five':
                this.setStep('four');
                break;
        }
    }

    public nextStep() {
        switch (this.step) {
            case 'one':
                this.setVerificationCode();
                this.setStepsGa('Informações de contato');
                // this.setStep('two');
                break;
            case 'two':
                // this.createRegisterSellerAddress();
                this.openMapAddress();
                this.setStepsGa('Localização da empresa');
                // this.setStep('three');
                break;
            case 'three':
                this.createRegisterSellerCategory();
                this.setStepsGa('Categoria da empresa');
                this.prevDisabled = true;
                // this.setStep('four');
                break;
            case 'four':
                let stepThree = {};
                let stepFour = {};
                if (localStorage.getItem('stepThree')) {
                    stepThree = JSON.parse(localStorage.getItem('stepThree') || '');
                }
                if (localStorage.getItem('stepFour')) {
                    stepFour = JSON.parse(localStorage.getItem('stepFour') || '');
                }
                this.updateRegisterSeller({
                    seller_name: stepFour[0],
                    gender: stepFour[1].id,
                    document: stepFour[2] ? stepFour[2] : stepThree[4],
                }, 'five');
                this.prevDisabled = true;
                this.setStepsGa('Dados Pessoais');
                // this.setStep('five');
                break;
        }
    }

    public confirmAddressMap() {
        this.createRegisterSellerAddress();
        this.closeMapAddress();
    }

    private setStepTitle() {
        switch (this.step) {
            case 'one':
                this.titlePage = 'Faça o cadastro do seu negócio. É grátis!';
                break;
            case 'two':
                this.titlePage = 'Conta pra gente onde fica seu negócio!';
                break;
            case 'three':
                this.titlePage = 'Agora, precisamos saber um pouco sobre seu negócio!';
                break;
                case 'four':
                this.titlePage = 'Falta pouco! Conte mais sobre você.';
                break;
            case 'five':
                this.titlePage = 'Que bom que você está na Pertinho de Casa!';
                break;
        }
    }

    private async setDeviceId() {
        const device_id = (await Device.getId()).uuid;
        this.deviceId =  device_id;
        localStorage.setItem('device_id', JSON.stringify(device_id));
    }

    //Aqui faz o register
    private async signupSeller(code: string) {
        const stepOne = JSON.parse(localStorage.getItem('stepOne') || '');
        const stepOneTerms = JSON.parse(localStorage.getItem('stepOneTerms') || '');
        let partherData;

        if (localStorage.getItem('parther')) {
            partherData = JSON.parse(localStorage.getItem('parther') || '');
        }

        if (stepOne && stepOneTerms) {
            let partner = '';
            let observer = '';

            if (this.paramParther === 'gastromotiva') {
                partner = partherData ? partherData[0].id : '';
                observer = partherData ? partherData[1] : '';
            } else if (this.paramParther === 'oi') {
                partner = 'oi';
                observer = partherData[0].label === 'Outros' ? `Outros-${partherData[1]}` : partherData[0].label;
            } else if (this.paramParther) {
                partner = this.paramParther;
            }

            const data = {
                name: stepOne[0],
                mobile: this.removeMask(stepOne[1]),
                email: stepOne[2],
                device_id: this.deviceId,
                auth: 2,
                opt_in: stepOneTerms.optIn,
                partner,
                observer,
                update: this.isUpdate,
                origin_by_way: this.originByWay
            }

            if (!this.originByWay) {
                delete data.origin_by_way;
            }

            const response = await this.registerService.createRegisterSeller(data);
            switch (response.status) {
                case 201:
                    this.codeLoginSeller(code);
                    break;
                case 400:
                case 404:
                case 423:
                    const error = await response.json();
                    Object.keys(error).forEach(value => {
                        switch (value) {
                            case 'mobile':
                                this.setHelp(this.step1, 1, error.mobile[0], 'invalid');
                                break;
                            case 'email':
                                this.setHelp(this.step1, 2, error.email[0], 'invalid');
                                break;
                        }
                    });
                    this.loginSeller();
                    break;
            }
        }
    }

    private async loginSeller() {
        const stepOne = JSON.parse(localStorage.getItem('stepOne') || '');
        const stepOneTerms = JSON.parse(localStorage.getItem('stepOneTerms') || '');
        const response = await this.registerService.loginSeller({
            name: stepOne[0],
            mobile: this.removeMask(stepOne[1]),
            email: stepOne[2],
            device_id: this.deviceId,
            auth: 2,
            opt_in: stepOneTerms.optIn,
        });
        switch (response.status) {
            case 200:
            case 201:
            case 202:
                this.openVerificationCode();
                break;
            case 400:
            case 404:
            case 423:
                const error = await response.json();
                this.toastMessage('error', error.detail ? error.detail : error);
                break;
        }
    }

    private async confirmCodeSeller(code: string){
        const stepOne = JSON.parse(localStorage.getItem('stepOne') || '');
        const response = await this.registerService.confirmMobileCode(this.removeMask(stepOne[1]), this.deviceId, 2, code);
        console.log("---response confirmCodeSeller---", response)
        switch (response.status) {
            case 200:
            case 201:
            case 202:
                this.signupSeller(code)
                break;
            case 400:
            case 404:
            case 423:
                const error = await response.json();
                this.toastMessage('error', error.detail ? error.detail : error);
                this.setStepsGa('Token errado');
                break;
        }
    }

    private async codeLoginSeller(code: string) {        
        const stepOne = JSON.parse(localStorage.getItem('stepOne') || '');
        const response = await this.registerService.codeLoginSeller({
            email: this.removeMask(stepOne[1]),
            code,
            device_id: this.deviceId,
            auth: 2,
        });
        console.log("response codeLoginSeller", response)
        switch (response.status) {
            case 200:
            case 201:
            case 202:
                const data = await response.json();
                localStorage.setItem('pertinho', JSON.stringify(data));
                UserStorage.saveData(JSON.stringify(data));
                this.getUser();
                this.closeVerificationCode();
                this.setStepsGa('Confirmação de token');
                break;
            case 400:
            case 404:
            case 423:
                const error = await response.json();
                this.toastMessage('error', error.detail ? error.detail : error);
                this.setStepsGa('Token errado');
                break;
        }
    }

    private async getUser() {
        const response = await this.productsService.getProdcutsAll();
        switch (response.status) {
            case 200:
            case 201:
            case 202:
                const data = await response.json();
                localStorage.setItem('loggedUser', JSON.stringify(data));
                const loggedUser = JSON.parse(localStorage.getItem('loggedUser') || '');
                this.toastMessage('success', `Bem vindo, ${loggedUser.name}!`);
                (data.account_status !== 'F')
                    ? this.setStep(this.convertAccountStatusToSteps(data.account_status))
                    : this.setStep('two');
                break;
            case 400:
            case 404:
            case 423:
                const error = await response.json();
                this.toastMessage('error', error.detail ? error.detail : error);
                break;
        }
    }

    private async createRegisterSellerAddress() {
        const address = JSON.parse(localStorage.getItem('stepTwoAddress') || '');
        const myLatlng = JSON.parse(localStorage.getItem('latlng') || '');
        address.lat = myLatlng.lat;
        address.lng = myLatlng.lng;
        const pertinho = JSON.parse(localStorage.getItem('pertinho') || '');
        const response = await this.registerService.createRegisterSellerAddress(address, pertinho);
        switch (response.status) {
            case 201:
                this.setStep('three');
                break;
            case 400:
            case 404:
            case 423:
                const error = await response.json();
                this.toastMessage('error', error.detail ? error.detail : error);
                break;
        }
    }

    private async createRegisterSellerCategory() {
        const stepThree = JSON.parse(localStorage.getItem('stepThree') || '');
        (stepThree[4])
            ? this.step4[2].showInput = false
            : this.step4[2].showInput = true;
        const pertinho = JSON.parse(localStorage.getItem('pertinho') || '');
        const response = await this.registerService.createRegisterSellerCategory({ cnae: stepThree[1].cnae }, pertinho);
        switch (response.status) {
            case 201:
                this.updateRegisterSeller({
                    about: stepThree[2],
                    size: stepThree[3].id,
                    document: stepThree[4],
                }, 'four');
                break;
            case 400:
            case 404:
            case 423:
                const error = await response.json();
                this.toastMessage('error', error.detail ? error.detail : error);
                break;
        }
    }

    private async updateRegisterSeller(resgister, nextStep) {
        const pertinho = JSON.parse(localStorage.getItem('pertinho') || '');
        const response = await this.registerService.updateRegisterSeller(resgister, pertinho);
        switch (response.status) {
            case 201:
            case 202:
                this.setStep(nextStep);
                if (nextStep === 'five') {
                    this.setStepsGa('Finalizou cadastro');
                    localStorage.removeItem('stepOne');
                    localStorage.removeItem('stepTwo');
                    localStorage.removeItem('stepThree');
                    localStorage.removeItem('stepFour');
                    localStorage.removeItem('stepform');
                    localStorage.removeItem('stepTwoAddress');
                    localStorage.removeItem('latlng');
                }
                break;
            case 400:
            case 404:
            case 423:
                const error = await response.json();
                this.toastMessage('error', error);
                break;
        }
    }

    private setHelp(step, index: number, helpMsg: string, type: TypeHelp ) {
        step[index].help = helpMsg;
        switch (type) {
            case 'valid':
                step[index].classHelp = 'form-text valid-feedback';
                step[index].classInput = 'form-control is-valid';
                break;
            case 'invalid':
                step[index].classHelp = 'form-text invalid-feedback';
                step[index].classInput = 'form-control is-invalid';
                break;
            case 'normal':
                step[index].classHelp = 'form-text text-muted';
                step[index].classInput = 'form-control';
                break;
        }
    }

    private removeMask(mobile) {
        return mobile.replace(/[^0-9]/g, '');
    }

    private randomNumberLetters() {
        const d = new Date();
        const n = d.getTime();
        return Math.floor(Math.random() * 65536) + Math.random().toString(36).replace(/[^a-z]+/g, '').substr(0, 5) + 'PERTINHO' + n;
    }

    private isMobile() {
        return Boolean(/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent));
    }

    private setVerificationCode() {
        if (localStorage.getItem('stepOne')) {
            const stepOne = JSON.parse(localStorage.getItem('stepOne') || '');
            this.businessName = stepOne[0];
            this.phone = stepOne[1];
            this.email = stepOne[2];
        }
        if (this.validateFirstStep()) {
            this.confirmMobile()
        }     
    }

    private validateFirstStep(){
        const stepOneTerms = JSON.parse(localStorage.getItem('stepOneTerms') || '');
        if (!this.businessName) {
            this.toastMessage('error', "Por favor deve preencher o campo nome da empresa");
            return false;
        }
        if (!this.phone) {
            this.toastMessage('error', "Por favor deve preencher o campo telefone");
            return false;
        }
        if (!this.email) {
            this.toastMessage('error', "Por favor deve preencher o campo E-mail");
            return false;
        }
        if (!stepOneTerms.terms) {
            this.toastMessage('error', "Por favor deve aceitar os termos e políticas de privacidade");
            return false;
        }
        return true;
    }

    private async confirmMobile(){
        const response = await this.registerService.confirmMobile(this.phone, this.email, this.deviceId, 2)

        switch (response.status) {
            case 201:
                this.openVerificationCode();
                break;
            case 400:
            case 404:
            case 423:
                const error = await response.json();
                Object.keys(error).forEach(value => {
                    switch (value) {
                        case 'mobile':
                            this.setHelp(this.step1, 1, error.mobile[0], 'invalid');
                            break;
                        case 'email':
                            this.setHelp(this.step1, 2, error.email[0], 'invalid');
                            break;
                    }
                });
                this.loginSeller();
                break;
        }

    }

    private storageStepCurrent() {
        localStorage.setItem('stepform', this.step);
    }

    public storageInputsStep(step: string, inputsModel: Array<{}>) {
        localStorage.setItem(step, JSON.stringify(inputsModel));
    }

    private setModelsArrayInput(step: string, arrayInputs: InputForms[]) {
        if (localStorage.getItem(step)) {
            return arrayInputs.forEach((input, index) => input.model = JSON.parse(localStorage.getItem(step) || '')[index]);
        }
    }

    public openOptInModal() {
        this.showOptIn = true;
    }

    public closeOptInModal() {
        this.showOptIn = false;
    }

    public setOptIn(optIn: string) {
        this.optIn = optIn;
    }

    public openVerificationCode() {
        this.showVerificationCode = true;
    }

    public closeVerificationCode() {
        this.showVerificationCode = false;
    }

    public openMapAddress() {
        this.showMapAddress = true;
    }

    public closeMapAddress() {
        this.showMapAddress = false;
    }

    public refreshCodeConfirm() {
        this.loginSeller();
    }

    public codeConfirm(code: string) {
        console.log("sssss")
        // this.codeLoginSeller(code);
        this.confirmCodeSeller(code);
    }

    public updateUserPhone(){
        this.isUpdate = true;
        this.showVerificationCode = false;
    }

    private setStepsGa = (action: string) => {
        this.$setGtm({
            event: 'step-cadastro',
            nomeStep: action,
        });
    }

    private convertSteps = (step: string): number => {
        let index = 0;
        switch (step) {
            case 'one':
            case 'P':
                index = 1;
                break;
            case 'two':
            case 'C':
                index = 2;
                break;
            case 'three':
            case 'E':
                index = 3;
                break;
            case 'four':
            case 'D':
                index = 4;
                break;
            case 'five':
            case 'F':
                index = 5;
                break;
        }
        return index;
    }

    private convertAccountStatusToSteps(accountStatus: string): string {
        let step = 'one';
        switch (accountStatus) {
            case 'P':
                step = 'one';
                break;
            case 'E':
                step = 'two';
                break;
            case 'C':
                step = 'three';
                break;
            case 'D':
                step = 'four';
                break;
            case 'F':
                step = 'five';
                break;
        }
        return step;
    }

    private toastMessage(type: SweetAlertType, title: string) {
        VueSimpleAlert.fire({
            type,
            title,
            toast: true,
            position: 'top-end',
            showConfirmButton: false,
            timer: 5000,
            onOpen: (toast) => {
                toast.addEventListener('mouseenter', Swal.stopTimer),
                toast.addEventListener('mouseleave', Swal.resumeTimer);
            },
        });
    }
}
